import { MessageDto } from './dto/message.dto'

export class MessageApi {
  public static async createOne(): Promise<MessageDto[]> {
    const resp = await fetch('http://localhost:4000/messages/', {
      method: 'POST',
    })

    return await resp.json()
  }
}
